  const debounce = function (e, d) {
    if (timer) {
      clearTimeout(timer);
    }
    timer = setTimeout(() => {
      if (document.getElementById("url_form")) {
        document.getElementById("url_form").submit();
      }
    }, d);
  };

  useEffect(() => {
    debounce("test", 1000);
  }, [data]);

  function changeNote() {
    changeServiceNote(document.getElementById("serviceVisitNote").value);
  }

  function redirectContractQuotationPage() {
    if (data?.contract_id && data?.contract_id != "") {
      window.open(`/contracts/${data?.contract_id}/details`);
    } else if (data?.quotation_id && data?.quotation_id != "") {
      window.open(`/quotes/${data?.quotation_id}/details`);
    }
  }

  function genereateQrCode() {
    let string = `https://masterclean.hk?j_no=${data?.job_no}&j_id=${data?._id}`;
    var encodedString = btoa(string);
    return encodedString;
  }

